import React, { Component} from 'react';
import axios from 'axios';

export default class Servicios extends Component {
    state = {
        prop: []
    }

    componentDidMount() {
        axios.get('http://localhost:3001/propiedades')
            .then(res => {
                const prop = res.data;
                this.setState({ prop });
            })
    }

    render() {
        return (
            <ul>
                { this.state.prop.map((post, index) =>
                    <div key={index.id} >
                    <>
                        <h3>
                            {post.tittle}
                        </h3>
                        <li>
                            {post.region}
                        </li>
                        </>
                        </div>
                )
                }
            </ul>
        )
    }
}
